import React from "react";
import countrySelect from "./CountrySelect.jsx";

let visitedCountries = ["Canada","Ireland","Egypt","Czech Republic","Germany","France","Greece","Iceland","Italy","Japan","Lao People's Democratic Republic","Mexico","Norway","Poland","Thailand"];
function recieveCountry (props){
    let contains = visitedCountries.includes(props.name); 
    console.log(props);
    if (contains === true){
        console.log("true");
        countrySelect(props);
    }else{
        console.log("false")
    }
}

export default recieveCountry;
